        <div className="box">
            <span className="sec emailSec"><input value={"mushfiqurnasim@gmail.com"} readOnly/></span>
            <span className="sec iconSec"><FontAwesomeIcon icon={faCopy} className="icon" /></span>
        </div>
    )
}

